import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import ShowReelForm from './components/ShowReelForm';
import ClipList from './components/VideoClipList';
import ClipForm from './components/VideoClipForm';
import ShowReelList from './components/ShowReelList'; // Import the ShowReelList component

const App = () => {
  return (
    <Router>
      <div>
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <div className="container">
            <Link className="navbar-brand" to="/">Show Reel Application</Link>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav">
                <li className="nav-item">
                  <Link className="nav-link" to="/show_reels">Show All Reels</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/create_reel">Create Reel</Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <div className="container mt-4">
          <h1>Show Reel Application</h1>
          <Switch>
            <Route path="/show_reels" component={ShowReelList} />
            <Route path="/create_reel" component={ShowReelForm} />
            <Route path="/clips" component={ClipList} />
            <Route path="/create_clip" component={ClipForm} />
          </Switch>
        </div>
      </div>
    </Router>
  );
};

export default App;
